import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import processImg from '../src/processImg.svg';

function Process() {
  return (
    <Container
      maxWidth="xl"
      style={{
        background: '#F2E7D6',
        position: "relative",
        paddingBottom: '5%', // Adjust padding for the bottom of the container
      }}
    >
      <Grid
        container
        spacing={4}
        alignContent="flex-end"
        alignItems="flex-end"
        justifyContent="center"
        style={{ position: "relative" }}
      >
        <Grid item xs={12} sm={8}>
          {/* Use xs={12} to make it full width on small screens */}
          <h1
            style={{
              fontSize: "3rem", // Responsive font size
              fontFamily: "yeseva one",
              position: "relative",
              paddingLeft: "10%",
            }}
          >
            The Process
          </h1>
        </Grid>
        <Grid item xs={12} sm={4}>
          {/* Use xs={12} to make it full width on small screens */}
          <img
            className="my-svg"
            src={processImg}
            height="150px"
            style={{ position: "relative", maxWidth: "100%" }} // Make the image responsive
            alt="Process Image"
          />
        </Grid>
      </Grid>
      <hr style={{ width: '100%', borderColor: "black", marginLeft: 0 }} />
      <Grid
        container
        spacing={4}
        alignContent="flex-end"
        alignItems="flex-end"
        justifyContent="center"
      >
        <Grid item xs={12} sm={8}>
          {/* Use xs={12} to make it full width on small screens */}
          <Box p={0}>
            <p
              style={{
                marginLeft: "5%",
                lineHeight: "30px",
                fontFamily: "josefin sans",
                fontSize: "1.5rem", // Responsive font size
                position: "relative",
                width: "205%", // Make text full width on small screens
              }}
            >
              A customer-oriented consulting process. Whatever the challenge,
              time frame, and budget, I can help you on your journey to success.
              A process with the ultimate goal of making you happy.
            </p>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Process;
